tion of ribosomal RNA (rRNA) genes. Binds specifically to the boxA antiterminator sequence of the ribosomal RNA (rrn) operons","Carrier of the growing fatty acid chain in fatty acid biosynthesis","","","Attaches a formyl group to the free amino group of methionyl-tRNA(fMet). The formyl group appears to play a dual role in the initiator identity of N-formylmethionyl-tRNA by promoting its recognition by IF2 and preventing the misappropriation of this tRNA by the elongation apparatus","","","","Catalyzes the reversible adenylation of nicotinate mononucleotide (NaMN) to nicotinic acid adenine dinucleotide (NaAD)","","","","Catalyzes the reversible epimerization of D-ribulose 5-phosphate to D-xylulose 5-phosphate","","","","","","Releases the supercoiling and torsional tension of DNA, which is introduced during the DNA replication and transcription, by transiently cleaving and rejoining one strand of the DNA duplex. Introduces a single-strand break via transesterification at a target site in duplex DNA. The scissile phosphodiester is attacked by the catalytic tyrosine of the enzyme, resulting in the formation of a DNA-(5'-phosphotyrosyl)-enzyme intermediate and the expulsion of a 3'-OH DNA strand. The free DNA strand then undergoes passage around the unbroken strand, thus removing DNA supercoils. Finally, in the religation step, the DNA 3'-OH attacks the covalent intermediate to expel the active-site tyrosine and restore the DNA phosphodiester backbone","","","","Required for a late step of 50S ribosomal subunit assembly. Has GTPase activity","Endonuclease that specifically degrades the RNA of RNA-DNA hybrids","Specifically methylates guanosine-37 in various tRNAs","Involved in mRNA degradation. Catalyzes the phosphorolysis of single-stranded polyribonucleotides processively in the 3'- to 5'-direction","Forms an intersubunit bridge (bridge B4) with the 23S rRNA of the 50S subunit in the ribosome","","","","Catalyzes the conversion of acetate into acetyl-CoA (AcCoA), an essential intermediate at the junction of anabolic and catabolic pathways. AcsA undergoes a two-step reaction. In the first half reaction, AcsA combines acetate with ATP to form acetyl-adenylate (AcAMP) intermediate. In the second half reaction, it can then transfer the acetyl group from AcAMP to the sulfhydryl group of CoA, forming the product AcCoA","","","","Required for chromosome condensation and partitioning","","","Poorly processive, error-prone DNA polymerase involved in untargeted mutagenesis. Copies undamaged DNA at stalled replication forks, which arise in vivo from mismatched or misaligned primer ends. These misaligned primers can be extended by PolIV. Exhibits no 3'-5' exonuclease (proofreading) activity. May be involved in translesional synthesis, in conjunction with the beta clamp from PolIII","","","This protein is located at the 30S-50S ribosomal subunit interface and may play a role in the structure and function of the aminoacyl-tRNA binding site","Specifically methylates guanosine-37 in various tRNAs","An accessory protein needed during the final step in the assembly of 30S ribosomal subunit, possibly for assembly of the head region. Essential for efficient processing of 16S rRNA. May be needed both before and after RbfA during the maturation of 16S rRNA. It has affinity for free ribosomal 30S subunits but not for 70S ribosomes","A probable RNA chaperone. Forms a complex with KhpB which binds to cellular RNA and controls its expression. Plays a role in peptidoglycan (PG) homeostasis and cell length regulation","","Involved in targeting and insertion of nascent membrane proteins into the cytoplasmic membrane. Binds to the hydrophobic signal sequence of the ribosome-nascent chain (RNC) as it emerges from the ribosomes. The SRP-RNC complex is then targeted to the cytoplasmic membrane where it interacts with the SRP receptor FtsY","Might take part in the signal recognition particle (SRP) pathway. This is inferred from the conservation of its genetic proximity to ftsY/ffh. May be a regulatory protein","A probable RNA chaperone. Forms a complex with KhpB which binds to cellular RNA and controls its expression. Plays a role in peptidoglycan (PG) homeostasis and cell length regulation"],"go_terms":["n.a.","n.a.","C:membrane","C:membrane","C:cytosol; F:ATP binding; F:DNA binding; F:structural constituent of chromatin; P:chromosome condensation","C:membrane","C:cytoplasm; F:double-stranded RNA binding; F:metal ion binding; F:rRNA binding; F:ribonuclease III activity; P:U4 snRNA 3'-end processing; P:mRNA processing; P:pre-miRNA processing; P:primary miRNA processing; P:rRNA processing; P:tRNA processing; P:termination of RNA polymerase II transcription","C:cytosol; F:RNA binding; P:DNA-templated transcription termination; P:transcription antitermination","C:cytosol; F:acyl binding; F:acyl carrier activity; P:lipid A biosynthetic process","C:membrane; F:oxidoreductase activity","F:lipid binding","C:cytosol; F:methionyl-tRNA formyltransferase activity","C:cytoplasm; F:nucleic acid binding","C:plasma membrane; F:metalloendopeptidase activity; F:zinc ion binding; P:proteolysis","","F:ATP binding; F:nicotinate-nucleotide adenylyltransferase activity; P:NAD biosynthetic process","F:nucleic acid binding","C:membrane; F:protein serine/threonine kinase activity","C:cytoplasm; C:cytosol; F:ATP binding; F:RNA binding; F:histidine-tRNA ligase activity; F:identical protein binding; F:transferase activity; P:histidyl-tRNA aminoacylation","C:cytosol; F:D-ribulose-phosphate 3-epimerase activity; F:metal ion binding; P:pentose catabolic process; P:pentose-phosphate shunt, non-oxidative branch","","","","P:cell division","","C:chromosome; F:DNA binding; F:DNA topoisomerase type I (single strand cut, ATP-independent) activity; F:metal ion binding; P:DNA topological change","F:mannose-1-phosphate guanylyltransferase (GTP) activity; F:nucleotide binding; P:GDP-mannose biosynthetic process","P:DNA-mediated transformation","C:ATP-binding cass ng the misappropriation of this tRNA by the elongation apparatus","","","","Catalyzes the reversible adenylation of nicotinate mononucleotide (NaMN) to nicotinic acid adenine dinucleotide (NaAD)","","","","Catalyzes the reversible epimerization of D-ribulose 5-phosphate to D-xylulose 5-phosphate","","","","","","Releases the supercoiling and torsional tension of DNA, which is introduced during the DNA replication and transcription, by transiently cleaving and rejoining one strand of the DNA duplex. Introduces a single-strand break via transesterification at a target site in duplex DNA. The scissile phosphodiester is attacked by the catalytic tyrosine of the enzyme, resulting in the formation of a DNA-(5'-phosphotyrosyl)-enzyme intermediate and the expulsion of a 3'-OH DNA strand. The free DNA strand then undergoes passage around the unbroken strand, thus removing DNA supercoils. Finally, in the religation step, the DNA 3'-OH attacks the covalent intermediate to expel the active-site tyrosine and restore the DNA phosphodiester backbone","","","","Required for a late step of 50S ribosomal subunit assembly. Has GTPase activity","Endonuclease that specifically degrades the RNA of RNA-DNA hybrids","Specifically methylates guanosine-37 in various tRNAs","Involved in mRNA degradation. Catalyzes the phosphorolysis of single-stranded polyribonucleotides processively in the 3'- to 5'-direction","Forms an intersubunit bridge (bridge B4) with the 23S rRNA of the 50S subunit in the ribosome","","","","Catalyzes the conversion of acetate into acetyl-CoA (AcCoA), an essential intermediate at the junction of anabolic and catabolic pathways. AcsA undergoes a two-step reaction. In the first half reaction, AcsA combines acetate with ATP to form acetyl-adenylate (AcAMP) intermediate. In the second half reaction, it can then transfer the acetyl group from AcAMP to the sulfhydryl group of CoA, forming the product AcCoA","","","","Required for chromosome condensation and partitioning","",  processing of primary rRNA transcript to yield the immediate precursors to the large and small rRNAs (23S and 16S). Processes some mRNAs, and tRNAs when they are encoded in the rRNA operon. Processes pre-crRNA and tracrRNA of type II CRISPR loci if present in the organism","Involved in transcription antitermination. Required for transcription of ribosomal RNA (rRNA) genes. Binds specifically to the boxA antiterminator sequence of the ribosomal RNA (rrn) operons","Carrier of the growing fatty acid chain in fatty acid biosynthesis","","","Attaches a formyl group to the free amino group of methionyl-tRNA(fMet). The formyl group appears to play a dual role in the initiator identity of N-formylmethionyl-tRNA by promoting its recognition by IF2 and preventing the misappropriation of this tRNA by the elongation apparatus","","","","Catalyzes the reversible adenylation of nicotinate mononucleotide (NaMN) to nicotinic acid adenine dinucleotide (NaAD)","","","","Catalyzes the reversible epimerization of D-ribulose 5-phosphate to D-xylulose 5-phosphate","","","","","","Releases the supercoiling and torsional tension of DNA, which is introduced during the DNA replication and transcription, by transiently cleaving and rejoining one strand of the DNA duplex. Introduces a single-strand break via transesterification at a target site in duplex DNA. The scissile phosphodiester is attacked by the catalytic tyrosine of the enzyme, resulting in the formation of a DNA-(5'-phosphotyrosyl)-enzyme intermediate and the expulsion of a 3'-OH DNA strand. The free DNA strand then undergoes passage around the unbroken strand, thus removing DNA supercoils. Finally, in the religation step, the DNA 3'-OH attacks the covalent intermediate to expel the active-site tyrosine and restore the DNA phosphodiester backbone","","","","Required for a late step of 50S ribosomal subunit assembly. Has GTPase activity","Endonuclease that specifically degrades the RNA of RNA-DNA hybrids","Specifically methylates guanosine-37 in various tRNAs","Involved in mRNA degradation. Catalyzes the phosphorolysis of single-stranded polyribonucleotides processively in the 3'- to 5'-direction","Forms an intersubunit bridge (bridge B4) with the 23S rRNA of the 50S subunit in the ribosome","","","","Catalyzes the conversion of acetate into acetyl-CoA (AcCoA), an essential intermediate at the junction of anabolic and catabolic pathways. AcsA undergoes a two-step reaction. In the first half reaction, AcsA combines acetate with ATP to form acetyl-adenylate (AcAMP) intermediate. In the second half reaction, it can then transfer the acetyl group from AcAMP to the sulfhydryl group of CoA, forming the product AcCoA","","","","Required for chromosome condensation and partitioning","","","Poorly processive, error-prone DNA polymerase involved in untargeted mutagenesis. Copies undamaged DNA at stalled replication forks, which arise in vivo from mismatched or misaligned primer ends. These misaligned primers can be extended by PolIV. Exhibits no 3'-5' exonuclease (proofreading) activity. May be involved in translesional synthesis, in conjunction with the beta clamp from PolIII","","","This protein is located at the 30S-50S ribosomal subunit interface and may play a role in the structure and function of the aminoacyl-tRNA binding site","Specifically methylates guanosine-37 in various tRNAs","An accessory protein needed during the final step in the assembly of 30S ribosomal subunit, possibly for assembly of the head region. Essential for efficient processing of 16S rRNA. May be needed both before and after RbfA during the maturation of 16S rRNA. It has affinity for free ribosomal 30S subunits but not for 70S ribosomes","A probable RNA chaperone. Forms a complex with KhpB which binds to cellular RNA and controls its expression. Plays a role in peptidoglycan (PG) homeostasis and cell length regulation","","Involved in targeting and insertion of nascent membrane proteins into the cytoplasmic membrane. Binds
